(4619, 'Jose Antonio  Vieira  Rangel MEI', 'Oficina dos Sabores', NULL, NULL, NULL, '*', NULL, NULL, '18.527.789/0001-07', NULL, NULL, NULL, NULL, NULL, '2701-3457', NULL, '7891-3366', 'Rua Campinas 13 ', NULL, NULL, 'Trindade - São Gonçalo', NULL, NULL, 'São Gonçalo', 'RJ', '24456-230', 'Laura', '6', '"... Existem pessoas que nos abraçam mesmo sem estar perto. Algumas vezes são por palavras doces, outras porque de alguma forma se fazem presente. Delas provém gestos bonitos de afeto que nos mostram o quanto se importam, o quanto nos querem bem e se tem uma coisa na vida que nada no mundo paga é o carinho sincero. Pessoas assim são pequenos diamantes que aprendemos a lapidar com sorriso, com ternura e toda doçura que nos cabe. Dessas eu não me afasto. E a Deus agradeço todos os dias por tê-las por perto..."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jose Antonio  Vieira  Rangel MEI', NULL),
